// ==UserScript==
// @name     	 	 HorribleSubs Tweak
// @version  	 	 1.1
// @namespace	 	 HSTWK
// @description	 Bright Skin for HorribleSubs.info with less clicks to download your daily animes.
// @grant    	 	 none
// @include  	 	 https://horriblesubs.info/
// @run-at   	 	 document-end
// @require  	 	 http://code.jquery.com/jquery-1.12.4.min.js
// ==/UserScript==
  
jQuery.noConflict();

jQuery(document).ready(function(){

  jQuery('head').append(`<style type="text/css">
    @keyframes cardmove1 {
     0% {
      transform: translate(210.2px, -3.8px);
     }
     12.5% {
      transform: translate(212.0px, 5.0px);
     }
     25% {
      transform: translate(210.2px, 13.8px);
     }
     37.5% {
      transform: translate(206.0px, 17.5px);
			opacity: 0.5;
     }
     50% {
      transform: translate(201.8px, 13.8px);
     }
     62.5% {
      transform: translate(200.0px, 5.0px);
     }
     75% {
      transform: translate(201.8px, -3.8px);
     }
     87.5% {
      transform: translate(206.0px, -7.5px);
			opacity: 1;
     }
     100% {
      transform: translate(210.2px, -3.8px);
     }
    }
    @keyframes cardmove2 {
     0% {
      transform: translate(40px, 30px) scale(1.2,1.2);
     }
     50% {
      transform: translate(10px, -20px) rotate(15deg);
     }
     100% {
      transform: translate(40px, 30px) scale(1.2,1.2);
     }
    }
	</style>`);  
  
  jQuery('#logo').html('<div></div><div></div><div>HorribleSubs</div><div></div>').css({'height':'70px','width':'319px','position':'relative','overflow':'visible'});
  jQuery('#logo div').css({'height':'70px','position':'absolute'});
  
 	jQuery('#logo div:nth-child(4n)').css({'width':'319px','background-image':'url(data:image/png;base64,)'});
	jQuery('#logo div:nth-child(4n+1)').css({'width':'55px','height':'54px','z-index':'1','background-image':'url(data:image/png;base64,)'});
	jQuery('#logo div:nth-child(4n+2)').css({'width':'38px','height':'33px','z-index':'1','background-image':'url(data:image/png;base64,)'});
  jQuery('#logo div:nth-child(4n+3)').css({'display':'block','height':'70px','width':'494px','position':'absolute','line-height':'35px','font-family':'Open Sans, serif','font-size':'36px','color':'#DA4453','font-weight': 'bold','padding-top': '33px','text-align':'right'});
  
  jQuery('#logo div:nth-child(4n+2)').css({'background-repeat':'no-repeat','-webkit-animation-name': 'cardmove1','animation-name': 'cardmove1','animation-timing-function': 'linear','animation-play-state':'running','animation-duration':'3s','animation-delay':'0s','animation-iteration-count':'infinite'});
  jQuery('#logo div:nth-child(4n+1)').css({'background-repeat':'no-repeat','-webkit-animation-name': 'cardmove2','animation-name': 'cardmove2','animation-play-state':'running','animation-duration':'6s','animation-delay':'0s','animation-iteration-count':'infinite'});
  
  jQuery('.container').css({'width':'1870px'});
  jQuery('.navbar').css({'background-color':'#2a2a2a','border-bottom':'6px solid #DA4453'});
  jQuery('<div id="tertiary" class="col-sm-12 col-md-6" style="order: 2;"></div>').append(jQuery('.comment-wrapper')).insertBefore(jQuery('#secondary'));
  jQuery(".main-content-inner").removeClass('col-md-7').addClass('col-md-3');
  jQuery("#secondary").css('order',2).removeClass('col-md-5').addClass('col-md-3');
  jQuery('.post-inner-content.releases-inner-content').insertBefore(jQuery('#main > .post-inner-content').first());
  jQuery('.entry-header').remove();
  jQuery('.post-inner-content').css({'padding':'10px 20px'});
  jQuery('h1').css({'margin-top':'10px','font-size':'24px'});
  jQuery('h2').css({'margin-top':'10px','margin-bottom':'5px'});
  setTimeout(function(){ jQuery('.badge').remove(); }, 500);
  
  jQuery('<span class="tweakme" style="position: absolute;margin: -40px 0 0;right: 60px;font-size: 24px;font-family: Open Sans,serif;color: #da4453;cursor: pointer;border-bottom: 1px dotted DarkRed;padding: 0;line-height: 24px;font-weight: bold;">HS TWEAK</span>').insertBefore(jQuery('#hs-latest-search'));
  
  jQuery('.tweakme').attr('onclick', `(function(){

		//if (jQuery('.tweaked').length === 0){

      //jQuery('.latest-sponsor').remove();
      jQuery('.main-content-inner style').remove();
			jQuery('.latest-releases ul').css({'margin': '0px -20px'});
      jQuery('.latest-releases li').css({'border-bottom':'1px solid #C3E0BB'});
      jQuery('.latest-releases a').css({'padding':'2px 10px','font-size':'11px'});
      jQuery('.latest-releases span').css({'float':'right', 'margin':'0'});
			jQuery('.latest-clear-button').css({'margin-top': '7px','margin-right': '25px'});
      jQuery('.latest-releases-res .badge').remove();
			jQuery('.ws').hide().text('▼ Show links ▼');
      jQuery('.latest-releases a').each(function(i,v){
        var href = jQuery(v).attr('href');
        var show = href.split('/').pop().split('#')[0];
				if (jQuery(this).parent('li').find('.toggle-dl').length === 0){
        	jQuery(v).after('<div class="toggle-dl" rel="' + show + '-' + i + '">▼ Show links ▼</div>'
                           +'<div rel="' + href + '" class="ws ws-' + show + '-' + i + '" style="display: none;"></div>');
				}
      });

      jQuery('.toggle-dl').off().click(function(){
        var show = jQuery(this).attr('rel');
        if (jQuery('.ws-' + show + ':visible').length > 0){
          jQuery('.ws-' + show).hide();
          jQuery(this).text('▼ Show links ▼');
        }else{
          jQuery('.ws' + show).hide();
          jQuery('.ws-' + show).show();    
          jQuery(this).text('▲ Hide links ▲');
          var href = jQuery('.ws-' + show).attr('rel');
          jQuery.get('https://horriblesubs.info' + href.replace('/show/','/shows/').replace('#','/#'), function(c){
            let showid = jQuery(c).find('script').text().split('hs_showid = ')[1].split(';')[0];
            jQuery.get('https://horriblesubs.info/api.php?method=getshows&type=show&showid=' + showid, function(s){
              jQuery('.latest-releases').addClass('tweaked');
              jQuery('.ws-' + show).html(s);
              jQuery('.rls-links-container').css({'font-size':'11px', 'display':'block'});
              jQuery('.dl-type').css({'margin':'0'});
              jQuery('.dl-type a').css({'padding':'0 4px'});
              jQuery('.rls-link').css({'padding':'0'});
              jQuery('.badge').css({'background-color':'#DA4453'});
              jQuery('.ws').css({'font-size':'10px'});
              jQuery('.rls-link-label').css({'margin-right':'4px','color':'#424242'});
              jQuery('.hs-xdcc-link a').css({'display':'inline'});
            });  	
          });    
        } //else
  		}).css({'text-align':'center','font-size': '10px','color':'#DA4453','cursor':'pointer'}); // clicked
		//} // if not tweaked yet

	})();`); // tweakme onclick

});